import React from "react";
import Style from "../style/style";
import Footer from "../components/Footer";

class App extends React.Component {
  style_back = {
    backgroundColor: "#42AAC7",
    height: "720px"
  };
  render() {
    return (
      <div>
        {Style}
        <div style={this.style_back}>
          <h1>Reactとは</h1>
          <Footer go="./Page2" />
        </div>
      </div>
    );
  }
}

export default App;
